import React, { useState } from 'react';
import { processInvoice } from '../services/api';
import './InvoiceProcessor.css';

const InvoiceProcessor = () => {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setError('');
    setResult(null);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!file) {
      setError('Por favor, selecione um arquivo PDF');
      return;
    }

    if (file.type !== 'application/pdf') {
      setError('Por favor, selecione apenas arquivos PDF');
      return;
    }

    setLoading(true);
    setError('');
    
    try {
      const data = await processInvoice(file);
      setResult(data);
    } catch (err) {
      setError('Erro ao processar o arquivo. Verifique se o backend está rodando.');
      console.error('Erro:', err);
    } finally {
      setLoading(false);
    }
  };

  const formatCurrency = (value) => {
    return new Intl.NumberFormat('pt-BR', {
      style: 'currency',
      currency: 'BRL'
    }).format(value || 0);
  };

  const formatCNPJ = (cnpj) => {
    if (!cnpj || cnpj === 'N/A') return 'N/A';
    return cnpj.replace(/(\d{2})(\d{3})(\d{3})(\d{4})(\d{2})/, '$1.$2.$3/$4-$5');
  };

  const formatCPF = (cpf) => {
    if (!cpf || cpf === 'N/A') return 'N/A';
    return cpf.replace(/(\d{3})(\d{3})(\d{3})(\d{2})/, '$1.$2.$3-$4');
  };

  return (
    <div className="invoice-processor">
      <h1>Processador de Notas Fiscais</h1>
      <p>Faça upload de uma nota fiscal em PDF para extrair os dados automaticamente</p>
      
      <form onSubmit={handleSubmit} className="upload-form">
        <div className="file-input-container">
          <input
            type="file"
            accept=".pdf"
            onChange={handleFileChange}
            className="file-input"
            id="pdfFile"
          />
          <label htmlFor="pdfFile" className="file-label">
            {file ? file.name : 'Selecionar PDF'}
          </label>
        </div>
        
        <button 
          type="submit" 
          disabled={loading || !file}
          className="process-button"
        >
          {loading ? 'Processando...' : 'Extrair Dados'}
        </button>
      </form>

      {error && (
        <div className="error-message">
          {error}
        </div>
      )}

      {result && result.data && (
        <div className="result-container">
          <h2>Dados Extraídos da Nota Fiscal</h2>
          
          {/* Informações Básicas */}
          <div className="summary-section">
            <h3>Informações da Nota</h3>
            <div className="summary-grid">
              <div className="summary-item">
                <span className="summary-label">Número NF:</span>
                <span className="summary-value">{result.data.numeroNotaFiscal || 'N/A'}</span>
              </div>
              <div className="summary-item">
                <span className="summary-label">Data Emissão:</span>
                <span className="summary-value">{result.data.dataEmissao || 'N/A'}</span>
              </div>
              <div className="summary-item">
                <span className="summary-label">Valor Total:</span>
                <span className="summary-value">{formatCurrency(result.data.valorTotal)}</span>
              </div>
              <div className="summary-item">
                <span className="summary-label">Parcelas:</span>
                <span className="summary-value">{result.data.quantidadeParcelas || 0}</span>
              </div>
            </div>
          </div>

          {/* Fornecedor */}
          <div className="supplier-section">
            <h3>Fornecedor</h3>
            <div className="supplier-info">
              <p><strong>Razão Social:</strong> {result.data.fornecedor?.razaoSocial || 'N/A'}</p>
              <p><strong>Nome Fantasia:</strong> {result.data.fornecedor?.fantasia || 'N/A'}</p>
              <p><strong>CNPJ:</strong> {formatCNPJ(result.data.fornecedor?.cnpj) || 'N/A'}</p>
            </div>
          </div>

          {/* Cliente */}
          <div className="client-section">
            <h3>Cliente</h3>
            <div className="client-info">
              <p><strong>Nome:</strong> {result.data.faturado?.nomeCompleto || 'N/A'}</p>
              <p><strong>CPF:</strong> {formatCPF(result.data.faturado?.cpf) || 'N/A'}</p>
            </div>
          </div>

          {/* Parcelas */}
          {result.data.parcelas && result.data.parcelas.length > 0 && (
            <div className="parcelas-section">
              <h3>Parcelas</h3>
              <div className="parcelas-table">
                <table>
                  <thead>
                    <tr>
                      <th>Vencimento</th>
                      <th>Valor</th>
                    </tr>
                  </thead>
                  <tbody>
                    {result.data.parcelas.map((parcela, index) => (
                      <tr key={index}>
                        <td>{parcela.dataVencimento || 'N/A'}</td>
                        <td className="number">{formatCurrency(parcela.valor)}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          )}

          {/* Descrição e Classificação */}
          <div className="description-section">
            <h3>Descrição e Classificação</h3>
            <div className="description-info">
              <p><strong>Descrição dos Produtos:</strong></p>
              <p>{result.data.descricaoProdutos || 'N/A'}</p>
              
              <p><strong>Classificação da Despesa:</strong></p>
              <p>{result.data.classificacaoDespesa?.join(', ') || 'N/A'}</p>
            </div>
          </div>

          {/* JSON Completo (para debug) */}
          <details className="json-details">
            <summary>JSON Completo (Debug)</summary>
            <pre className="result-json">
              {JSON.stringify(result, null, 2)}
            </pre>
          </details>
        </div>
      )}
    </div>
  );
};

export default InvoiceProcessor;
